import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

function Navbar() {
    return (<RouterContext.Consumer>
        <div className="Navbar">
            <Link>Home</Link>

        </div>
    </RouterContext.Consumer>

    );
}

export default Navbar;
